import React from "react";

class BankAccount {
  constructor(owner, balance) {
    this.owner = owner;
    this.balance = balance;
  }
  deposit(amount) {
    this.balance += amount;
    console.log(`la balance est de ${this.balance}  `);
  }
  withDraw(amount) {
    if (amount > this.balance) {
      console.log("No money");
    } else {
      this.balance -= amount;
      console.log(`le retrait est de ${this.balance}  `);
    }
  }
}

const newPersonn = new BankAccount("Moussa", 13000000);
newPersonn.deposit(70);
newPersonn.withDraw(70000);
console.log(newPersonn);
